	play_anim_loop: function(anim_name,stagee,sent_sound)
	{	
		if (sent_sound === undefined) {
          sent_sound = 0;
    	} 

		if (sent_sound)
		{
			ion.sound.play(sent_sound);
		}

		if (this.stage)
		{
			this.stage.destroy();
		}

		

		//this.stage = stagee;
		this.stage = new swiffy.Stage(document.getElementById(stagee), this[anim_name]);      
     	this.stage.setBackground(null);
     	this.stage.start();
	},

	play_anim_and_loop: function(anim_name1,anim_name2,time,stagee,sent_sound)
	{	
		if (sent_sound === undefined) {
          sent_sound = 0;
    	} 
    	
    	if (sent_sound)
		{
			ion.sound.play(sent_sound);
		}

		if (this.stage)
		{
			this.stage.destroy();
		}

		
		//this.stage = stagee;
		this.stage = new swiffy.Stage(document.getElementById(stagee), this[anim_name1]);      
     	this.stage.setBackground(null);
     	this.stage.start();
     	setTimeout(function(){animation_manager.play_anim_loop(anim_name2,stagee);},time);
	},

